// PubSub 订阅发布
var PubSub = (function () {
  var _listen
  var _trigger
  var _remove
  var _default = 'default'
  var namespaceCache = {}
  var _create
  var each = function (arr, fn) {
    var ret
    for (var i = 0; i < arr.length; i++) {
      var n = arr[i]
      ret = fn.call(n, i, n)
    }
    return ret
  }

  _listen = function (key, fn, cache) {
    if (!cache[key]) {
      cache[key] = []
    }
    cache[key].push(fn)
  }
  _remove = function (key, cache, fn) {
    if (!cache[key]) {
      return
    }
    if (fn) {
      for (var i = cache[key].length; i >= 0; i--) {
        if (cache[key] === fn) {
          cache[key].splice(i, 1)
        } else {
          cache[key] = []
        }
      }
    } else {
      cache[key] = []
    }
  }
  _trigger = function () {
    var cache = [].shift.call(arguments)
    var key = [].shift.call(arguments)
    var args = arguments
    var stack = cache[key]
    if (!stack || !stack.length) {
      return
    }
    return each(stack, function () {
      return this.apply(this, args)
    })
  }
  _create = function (ns) {
    var namespace = ns || _default
    var cache = {}
    var offlineStack = [] // 离线事件
    var ret = {
      listen: function (key, fn, last) {
        _listen(key, fn, cache)
        if (offlineStack === null) {
          return
        }
        if (last === 'last') {
          offlineStack.length && offlineStack.pop()()
        } else {
          each(offlineStack, function () {
            this()
          })
        }
        offlineStack = null
      },
      one: function (key, fn, last) {
        _remove(key, cache)
        this.listen(key, fn, last)
      },
      remove: function (key, fn) {
        _remove(key, cache, fn)
      },
      trigger: function () {
        var _self = this;
        [].unshift.call(arguments, cache)
        var args = arguments
        var fn = function () {
          return _trigger.apply(_self, args)
        }
        if (offlineStack) {
          return offlineStack.push(fn)
        }
        return fn()
      }
    }
    if (Object.prototype.toString.call(namespace).indexOf('object HTML') === 1 && namespace.getAttribute('id')) {
      namespace = namespace.getAttribute('id')
    }
    var result = namespace ? (namespaceCache[namespace] ? namespaceCache[namespace] : namespaceCache[namespace] = ret) : ret
    return result
  }
  return {
    create: _create,
    one: function (key, fn, last) {
      var event = this.create()
      event.one(key, fn, last)
    },
    remove: function (key, fn) {
      var event = this.create()
      event.remove(key, fn)
    },
    listen: function (key, fn, last) {
      var event = this.create()
      event.listen(key, fn, last)
    },
    trigger: function () {
      var event = this.create()
      event.trigger.apply(this, arguments)
    }
  }
})();

